import React from 'react'
import './App.css';
import Login from './components/Login';
import logo from './imagens/logo.png'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src='./' alt='Logo do app' title='Logo do app'/>
      <Login />
      </header>
    </div>
  );
}

export default App;
